// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom'; // Zmiana tu: dodajemy Routes

import OsobaList from './components/OsobaList';

function App() {
    return (
        <Router>
            <div>
                <h1>Moja Aplikacja React</h1>
                <Link to="/osoba-lista">
                    <button>Kliknij mnie</button>
                </Link>

                <Routes>
                    <Route path="/osoba-lista" element={<OsobaList />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
